videos.text:
This mudroom transformation has been an incredible journey, and I couldn’t have done it without the amazing brands who partnered with me and the inspiration from the One Room Challenge.

When I started this project, the garage was just a boring, messy space, but I saw its potential to become something functional and beautiful for my family. Over the past few weeks, I’ve built custom benches, installed cabinets, added shaker pegs, painted with a sprayer for the first time, and learned how to cut crown molding (with a little help from my dad). Every step came with its challenges, but it was so worth it to see this space come to life!

A huge thank you to my amazing sponsors: 
@OndecorStore for the stunning wallpaper that completely transformed this space. 

@SashcoInc for their game-changing color-matching caulk. 

@emtek_products for their gorgeous hardware that added the perfect finishing touch. 

@Lowe’s for being an incredible partner throughout this journey. 

@Graco Homeowner Sprayers for the paint sprayer that made the job so much easier! 

@Handypaintpail for the high quality and handy paint supplies 

And of course, a huge shoutout to @OneRoomChallenge®  and @Apartment Therapy for creating a community that inspires DIYers like me to push our limits. This was my first time participating, and it’s been nothing short of amazing! 

What’s your favorite part of this transformation? Let me know below! 

